import React from 'react'

import { Card, CardMedia, CardContent, Typography } from "@material-ui/core";
const PersonCard = ({id}) => {
    const firstName="Akash";
    const lastName = "kumar";
    const email="akmail.com";
  return (
    <>
      <Card sx={{ minWidth: 10000 }}>
        <CardMedia
          component="img"
          alt="green iguana"
          height="200"
          width={100}
          image="https://reqres.in/img/faces/7-image.jpg"
        />
        <CardContent>
          <Typography variant="h4">ID:{id}</Typography>
          <Typography variant="h6">firstName:{firstName}</Typography>
          <Typography variant="h6">lastName:{lastName}</Typography>
          <Typography variant="h6">Email:{email}</Typography>
        </CardContent>
      </Card>
    </>
  );
}

export default PersonCard
